import React, { Component, PropTypes } from 'react';

import axios from 'axios';
import Top5 from '../components/top5';
import { Grid } from '@material-ui/core';

class Home extends Component {
    constructor(props) {
        super(props);

    }
    state={
        top5:null,
        profile:null
    };
    componentDidMount(){
        axios.get('/getCounts').then(res=>{
            console.log(res);
            this.setState({
                top5:res.data
            })
        }).catch(err=>{
            console.log(err)
        })
    }


    render() {
        let displaytop5=this.state.top5? (<div><Top5 top5={this.state.top5}></Top5></div>):"Loading";
        return(
        <Grid container>
                <Grid item sm={12} xs={12}>
                    <h5><center>Most Affected States</center></h5>
                <div>{displaytop5}</div>
                </Grid>

            </Grid>
        );
    }
}

Home.propTypes = {

};

export default Home;
